import React from 'react';

class Dashboard extends React.Component {
  state = {
    email: ''
  };

  componentDidMount() {
    fetch('/secret')
      .then(res => res.json())
      .then(data => console.log(data));
  }

  render() {
    return (
      <div>
        <h3>I'm a private dashboard</h3>
      </div>
    );
  }
}

export default Dashboard;
